import React, { Component } from "react";

class Pagination extends Component {
  state = {};
  render() {
    return (
      <nav aria-label="Page navigation example">
        <ul class="pagination">
          <li class="page-item">
            <a class="page-link" href="#" onClick={() => this.props.onPage(1)}>
              1
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#" onClick={() => this.props.onPage(2)}>
              2
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#" onClick={() => this.props.onPage(3)}>
              3
            </a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Pagination;
